		this.charArray = [["Родион Романович Раскольников","23-24 года на момент начала повествования.\n(В эпилоге: ''чрез восемь лет ему будет\nтолько тридцать два года'')","rodion","''он был замечательно хорош собою,\nс прекрасными темными глазами, темно-рус,\nростом выше среднего, тонок и строен...''\n\n''Он был до того худо одет, что иной,\nдаже и привычный человек, посовестился бы\nднем выходить в таких лохмотьях на улицу.''","Обращаясь к городовому во время инци-\n-дента с обманутой девушкой:\n''- Я бывший студент, Раскольников...''\n\nОчень беден: ''Он был до того худо одет'',\n''Он был задавлен бедностью;''\n''второй день как уж он почти совсем ничего\nне ел.'',\n''с ненавистью посмотрел на свою каморку.\nЭто была крошечная клетушка, шагов в шесть\nдлиной, имевшая самый жалкий вид с своими\nжелтенькими, пыльными и всюду отставшими\nот стен обоями, и до того низкая, что чуть-чуть\nвысокому человеку становилось в ней жутко, и\nвсе казалось, что вот-вот стукнешься головой\nо потолок. ''","''с некоторого времени он был в\nраздражительном и напряженном состоянии\nпохожем на ипохондрию. Он до того\nуглубился в себя и уединился от всех,\nчто боялся даже всякой встречи''\n\nУ Порфирия, Порфирий: ''Все дело в том, что\nв ихней статье все люди как-то разделяются\nна ''обыкновенных'' и ''необыкновенных''...''\nРаскольников: ''Я просто-запросто намекнул,\nчто ''необыкновенный'' человек имеет право...\nто есть не официальное право, а сам имеет\nправо разрешить своей совести перешагнуть...\nчерез иные препятствия, и единственно в том\nтолько случае, если исполнение его идеи\nтого потребует.''\n\nНа каторге: ''Он, впрочем, не мог в этот вечер\nдолго и постоянно о чем-нибудь думать,\nсосредоточиться на чем-нибудь мыслью;\nда он ничего бы и не разрешил теперь\nсознательно; он только чувствовал. Вместо\nдиалектики наступила жизнь, и в сознании\nдолжно было выработаться что-то\nсовершенно другое..'' ","Достоевский пишет: ''Замечательно,\nчто Раскольников, быв в университете,\nпочти не имел товарищей, всех чуждался,\nни к кому не ходил и у себя принимал тяжело.\nВпрочем, и от него скоро все отвернулись.\nНи в общих сходках, ни в разговорах,\nни в забавах, ни в чем он как-то не принимал\nучастия. Занимался он усиленно, не жалея\nсебя, и за это его уважали, но никто не любил.''\n\nРазумихин: Полтора года я Родиона знаю:\nугрюм, мрачен, надменен и горд; в последнее\nвремя мнителен и ипохондрик. Великодушен\nи добр.''\n\nЛюбим матерью и сестрой.\n\nЛужин изначально видит его как ненужного,\nпри его планах, родственника; после встречи\nв каморке он окончательно видит его\nпреградой к власти над Дуней, выдвигает\nей и матери ультиматум: либо он, либо Родион.\nСоня видит в нем благодетеля, узнав о том,\nчто он - убийца Алены Ивановны и Лизаветы,\nона жалеет Раскольникова за его взгляды,\nприведшие к тяжкому греху."],["Семен Захарович Мармеладов","''Это был человек лет уже за пятьдесят''","marmeladov","среднего роста и плотного сложения,\nс проседью и с большою лысиной, с отекшим\nот постоянного пьянства желтым, даже\nзеленоватым лицом и с припухшими веками,\nиз-за которых сияли крошечные, как щелочки,\nно одушевленные красноватые глазки.\n\nВо взгляде его светилась как будто даже\nвосторженность, - пожалуй, был и смысл и ум,\n- но в то же время мелькало как будто и\nбезумие.''","В кабаке: ''состою титулярным советником...'',\n''изволили вы ночевать на Неве, на сенных\n барках? Я оттуда и уже пятую ночь.'',\n\nСемья Мармеладовых очень бедна.\n\n Является отчимом Лидочки, Коленьки и\n Полины, детей Екатерины Ивановны от\n первого брака, отец Софьи. Пьяница,\n это пристрастие на корню губит все его\n благие начинания и, во многом, служит\n причиной гибели Семена Захарыча.","''Во взгляде его ... мелькало как будто\nи безумие''\n\n''Я звериный образ имею'', ''такова уже черта\nмоя, а я прирожденный скот!'' - Мармеладов\nпонимает всю бедстсnвенность своего\nположения, понимает то, что алкоголь спутал\nему руки, что из-за своей болезни он причинил\nмного страданий близким, винит он в этом\nлишь себя.",""],["Софья Семеновна Мармеладова","18 лет.","sonya","Во время смерти Мармеладова:\nСоня была малого роста, лет восемнадцати,\nхуденькая, но довольно хорошенькая\nблондинка, с замечательными голубыми\nглазами.\n\nВ каморке Раскольникова: Теперь это была\nскромно и даже бедно одетая девушка, очень\nеще молоденькая, почти похожая на девочку,\nс скромною и приличною манерой, с ясным,\nно как будто несколько запуганным лицом.","Дочь чиновника в отставке Мармеладова,\nиз-за нищеты ''пошла по желтому билету''.","О себе:\n''Да ведь я... бесчестная... я великая, великая\nгрешница!''\nСтыдится своего позорного положения, очень\nнабожна.\n\nРазмышления Раскольникова:\n''почему она так слишком уже долго\nмогла оставаться в таком положении и не\nсошла с ума, если уж не в силах\nбыла броситься в воду? Конечно, он понимал,\nчто положение Сони есть явление случайное\nв обществе, хотя, к несчастию, далеко не\nодиночное и не исключительное.\nНо эта-то самая случайность, эта некоторая\nразвитость и вся предыдущая жизнь ее могли\nбы, кажется, сразу убить ее при первом шаге\nна отвратительной дороге этой. Что же\nподдерживало ее? Не разврат же? Весь этот\nпозор, очевидно, коснулся ее только\nмеханически; настоящий разврат еще не\nпроник ни одною каплей в ее сердце: он\nэто видел; она стояла перед ним наяву...''","Лужин:\n''девица отъявленного поведения'',\n\nПульхерия Алексадровна:\n''Этой девицы я тоже очень боюсь...''\n\nДуня:\n''А я уверена, что она... прекрасная и что все\nэто - вздор!''"],["Дмитрий Прокофьевич Разумихин","","none","ж","","",""],["Петр Петрович Лужин","","luzhin","","","",""],["Аркадий Иванович Свидригайлов","","svidrigaylov","","","",""]];
